// Utility to play notification sound
export const playNotificationSound = () => {
  try {
    // Check if user has interacted with the page (required for audio)
    if (document.visibilityState === 'hidden') {
      return; // Don't play sound if tab is not active
    }
    
    // Create a simple beep sound using Web Audio API
    const audioContext = new (window.AudioContext || (window as any).webkitAudioContext)();
    
    // Resume audio context if it's suspended
    if (audioContext.state === 'suspended') {
      audioContext.resume();
    }
    
    const oscillator = audioContext.createOscillator();
    const gainNode = audioContext.createGain();
    
    oscillator.connect(gainNode);
    gainNode.connect(audioContext.destination);
    
    oscillator.frequency.value = 1000; // Higher frequency for better audibility
    oscillator.type = 'sine';
    
    gainNode.gain.setValueAtTime(0.5, audioContext.currentTime);
    gainNode.gain.exponentialRampToValueAtTime(0.01, audioContext.currentTime + 0.3);
    
    oscillator.start(audioContext.currentTime);
    oscillator.stop(audioContext.currentTime + 0.3);
    
    // Play a second beep for emphasis
    setTimeout(() => {
      try {
        const oscillator2 = audioContext.createOscillator();
        const gainNode2 = audioContext.createGain();
        
        oscillator2.connect(gainNode2);
        gainNode2.connect(audioContext.destination);
        
        oscillator2.frequency.value = 800;
        oscillator2.type = 'sine';
        
        gainNode2.gain.setValueAtTime(0.3, audioContext.currentTime);
        gainNode2.gain.exponentialRampToValueAtTime(0.01, audioContext.currentTime + 0.2);
        
        oscillator2.start(audioContext.currentTime);
        oscillator2.stop(audioContext.currentTime + 0.2);
      } catch (e) {
        console.log('Could not play second beep:', e);
      }
    }, 200);
    
  } catch (error) {
    console.log('Could not play notification sound:', error);
    
    // Fallback: try to use a simple audio element
    try {
      const audio = new Audio('data:audio/wav;base64,'); // Base64 encoded beep sound
      audio.volume = 0.3;
      audio.play().catch(e => console.log('Could not play fallback audio:', e));
    } catch (fallbackError) {
      console.log('Could not play fallback notification sound:', fallbackError);
    }
  }
};

// Update favicon to show notification
export const updateFavicon = (hasNotifications: boolean) => {
  try {
    const canvas = document.createElement('canvas');
    canvas.width = 32;
    canvas.height = 32;
    const ctx = canvas.getContext('2d');
    
    if (!ctx) return;
    
    // Draw base icon (blue circle with dashboard icon)
    ctx.fillStyle = '#3B82F6';
    ctx.beginPath();
    ctx.arc(16, 16, 16, 0, 2 * Math.PI);
    ctx.fill();
    
    // Draw dashboard icon (simplified)
    ctx.fillStyle = 'white';
    ctx.fillRect(8, 8, 6, 6);
    ctx.fillRect(18, 8, 6, 6);
    ctx.fillRect(8, 18, 6, 6);
    ctx.fillRect(18, 18, 6, 6);
    
    // Add red notification dot if there are notifications
    if (hasNotifications) {
      ctx.fillStyle = '#EF4444';
      ctx.beginPath();
      ctx.arc(24, 8, 6, 0, 2 * Math.PI);
      ctx.fill();
    }
    
    // Update favicon
    const link = document.querySelector("link[rel*='icon']") as HTMLLinkElement || document.createElement('link');
    link.type = 'image/x-icon';
    link.rel = 'shortcut icon';
    link.href = canvas.toDataURL();
    document.getElementsByTagName('head')[0].appendChild(link);
  } catch (error) {
    console.log('Could not update favicon:', error);
  }
};